     &    (F11*Sub16(Gen(5),Neu(4),Sfe8) - F14*Sub21(Gen(5),Neu(4),Sfe8))

        Sub9(HelInd(Gen(5)),Gen(6),Neu(3),Neu(4),Sfe7,Sfe8) = 
